import ReactDOM from 'react-dom';

function Sitemap() {
    fetch("https://www.smu.edu.sg/sitemap.xml")
        .then(res => res.getText())
        .then(data => console.log(data));
    return (
        <p>Sitemap content</p>
    );
}

export default Sitemap;
